    height:100%;
    margin:1.2%;
}
display:grid;
grid-template-rows:50% 50%;
grid-template-columns:100%;
font-size:1.2rem;
.nome
{
 font-size:2rem;
 margin:0.8%;
 margin-left:2.4%;
 margin-bottom:-2.1%;

}
.orari
{
    font-size:0.9rem;
}
.map{
    left:2%;
